import React from "react";
import Homepage from "./components/Dashboard";
import Header from "./components/Header";
import { DndProvider } from "react-dnd";
import { HTML5Backend } from 'react-dnd-html5-backend';
// import { library } from '@fortawesome/fontawesome-svg-core'
// import { fas } from '@fortawesome/free-solid-svg-icons'

// import { faCheckSquare, faMugHot } from "@fortawesome/free-solid-svg-icons";

// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

// import { icon } from '@fortawesome/fontawesome-svg-core/import.macro'
// import { faCode, faHighlighter } from '@fortawesome/free-solid-svg-icons';
// import './fontawesome.js';

import { library } from '@fortawesome/fontawesome-svg-core';
import { faBoxingGlove } from '@fortawesome/pro-light-svg-icons';
import {
  faBoxingGlove as faBoxingGloveRegular
} from '@fortawesome/pro-regular-svg-icons';
import {
  faBoxingGlove as faBoxingGloveSolid
} from '@fortawesome/pro-solid-svg-icons';
// get our fontawesome imports
import { faHome } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";


library.add(
    faBoxingGlove,
    faBoxingGloveRegular,
    faBoxingGloveSolid
);    

// library.add( faCheckSquare, faMugHot);

const App = () => {
    return (
        <>
        <FontAwesomeIcon icon={['fas', 'boxing-glove']} />

                {/* <FontAwesomeIcon icon="fa-solid fa-dice-one" /> */}
                {/* <FontAwesomeIcon icon={['fas', 'code']} /> */}

        <DndProvider backend={HTML5Backend}>
            <Header />
            <Homepage />
        </DndProvider>
</>
    );
};

export default App;
